import React, { useEffect, useState } from 'react';
import { BrowserRouter as Router, Route, Routes } from 'react-router-dom';
import CarList from './Components/CarList';
import CarDetail from './Components/CarDetail';
import CarForm from './Components/CarForm';
import Login from './Components/Login';
import Register from './Components/Register';
import Header from './Components/Header';
import Footer from './Components/Footer';
import { AuthProvider } from './contexts/AuthContext';
import MarcaList from './Components/MarcaList';
import ModeloList from './Components/ModeloList';
import MarcaForm from './Components/MarcaForm';
import ModeloForm from './Components/ModeloForm';
import FilterSidebar from './Components/FilterSidebar';
import { Car, Filters } from './types';
import axios from './axiosConfig';
import './App.css';

const App: React.FC = () => {
    const [cars, setCars] = useState<Car[]>([]);
    const [filters, setFilters] = useState<Filters>({
        marca: '',
        modelo: '',
        ano: '',
        quilometragem_min: '',
        quilometragem_max: ''
    });

    useEffect(() => {
        if (isValidFilters(filters)) {
            fetchCars();
        }
    }, [filters]);

    const fetchCars = async () => {
        try {
            const response = await axios.get('/carros', { params: filters });
            setCars(response.data);
        } catch (error) {
            console.error('Error fetching cars', error);
        }
    };

    const handleFilterChange = (newFilters: Filters) => {
        if (isValidFilters(newFilters)) {
            setFilters(newFilters);
        }
    };

    const isValidFilters = (filters: Filters): boolean => {
        if (filters.quilometragem_min !== '' && filters.quilometragem_max !== '' && parseInt(filters.quilometragem_min, 10) > parseInt(filters.quilometragem_max, 10)) {
            return false;
        }
        return true;
    };

    return (
        <Router>
            <AuthProvider>
                <div className="container-fluid">
                    <Header />
                    <div className="main-content">
                        <div className="row" style={{ flex: 1 }}>
                            <div className="col-md-3">
                                <FilterSidebar onFilterChange={handleFilterChange} />
                            </div>
                            <div className="col-md-9">
                                <Routes>
                                    <Route path="/" element={<CarList cars={cars} edit={false} />} />
                                    <Route path="/carros/:id" element={<CarDetail />} />
                                    <Route path="/editarCarros" element={<CarList cars={cars} edit={true} />} />
                                    <Route path="/novo" element={<CarForm />} />
                                    <Route path="/editar/:id" element={<CarForm />} />
                                    <Route path="/login" element={<Login />} />
                                    <Route path="/register" element={<Register />} />
                                    <Route path="/marcas" element={<MarcaList />} />
                                    <Route path="/marcasNovo" element={<MarcaForm />} />
                                    <Route path="/marcas/:id" element={<MarcaForm />} />
                                    <Route path="/modelos" element={<ModeloList />} />
                                    <Route path="/modelosNovo" element={<ModeloForm />} />
                                    <Route path="/modelos/:id" element={<ModeloForm />} />
                                </Routes>
                            </div>
                        </div>
                    </div>
                    <Footer />
                </div>
            </AuthProvider>
        </Router>
    );
};

export default App;
